import React from 'react';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';

function App() {
    return (
        <>
            <div class="row">
                <div class="col-md-4">
                    <Card fname={Sdata[0].fname} imgsrc={Sdata[0].imgsrc} />
                </div>

                <div class="col-md-4">
                <Card fname={Sdata[1].fname} imgsrc={Sdata[1].imgsrc} />
                </div>

                <div class="col-md-4">
                <Card fname={Sdata[2].fname} imgsrc={Sdata[2].imgsrc} />
                </div>
            </div>
        </>
    );
}

export default App;
